async function copyImageToClipboard(o){if("https:"!=window.location.protocol)toastr.error('Please use "https" protocol to copy image.');else try{const t=$(o).attr("src");await CopyImageClipboard.copyImageToClipboard(t),toastr.success("Image copied to clipboard.")}catch(o){toastr.error('Your browser does not support "copy image to clipboard.')}}